 <h2 class=&quot;font-[var(--font-family-heading)] text-3xl sm:text-4xl lg:text-5xl font-bold text-[var(--dark-text-color)] mb-6 leading-tight&quot;>
 Dowiadczenie i empatia w subie Twojego zdrowia
 </h2>
 <p class=&quot;text-base sm:text-lg text-[var(--gray-text-color)] mb-6 leading-relaxed&quot;>
 Jestem fizjoterapeutk z wieloletnim dowiadczeniem w pracy z
 pacjentami w kadym wieku. Wierz, e kady przypadek jest wyjtkowy i
 wymaga indywidualnego podejcia.
 </p>
 <p class=&quot;text-base sm:text-lg text-[var(--gray-text-color)] mb-8 leading-relaxed&quot;>
 Moim celem nie jest tylko zagodzenie blu, ale przede wszystkim
 znalezienie i wyeliminowanie jego przyczyny. Pracuj z dziemi,
 osobami dorosymi oraz seniorami, pomagajc im odzyska pen
 sprawno i komfort ycia.
 </p>
